import React from "react";
import styled from "styled-components";
import HomeIcon from "@mui/icons-material/Home";

function Header() {
  return (
    <Container>
      <a>
        <HomeIcon />
      </a>
      <LeftMenu>
        <a href="#">Account</a>

        <a href="#">About</a>

        <a href="#">Contact</a>
      </LeftMenu>
      <RightMenu></RightMenu>
    </Container>
  );
}

export default Header;

const Container = styled.div`
  min-height: 40px;
  position: fixed;
  display: flex;
  align-items: center;
  padding: 0 20px;
  top: 0;
  left: 0;
  right: 0;
`;
const RightMenu = styled.div`
  display: flex;
`;
const LeftMenu = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  flex: 1;

  p {
    font-weight: 600;
    text-decoration: uppercase;
    padding: 0 10px; //top equals 0 sides equal 10
    flex-wrap: nowrap;
  }
`;
